import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import App from './pages/App'; 


const CustomRouter = () => {
  return (
    <Router>
    <Switch>
      <Route path="/app" component={App} />
    </Switch>
  </Router>
  );
};

export default CustomRouter;
